import React, { Component } from "react";
import Navbar from "./navbar";

class Home extends Component{
    render() {
        return (
            <React.Fragment>
                <Navbar/>
                <div>
                    <h1 className="display-2">Hello World!</h1>
                </div>
            </React.Fragment>
        );
    }
}
export default Home;
